import React,{useState} from 'react';
import { Link} from "react-router-dom"

const Dashnav = ({onAddButtonClick}) => {

  const [activeButton, setActiveButton] = useState('exploreEvent');

  const handleButtonClick = (buttonName) => {
    console.log("Button Name-->",buttonName);
    setActiveButton(buttonName);
  };

  const handleDashNav = () =>{
    
  }

  return (
    <div className='dashnav'>
        <div className="addbutton">
            <button  onClick={()=>{onAddButtonClick(true); handleButtonClick('addEvent');} } className={activeButton === 'addEvent' ? 'navactive' : ''}> + Add Event</button>
            <button   onClick={() => handleButtonClick('exploreEvent')} className={activeButton === 'exploreEvent' ? 'navactive exploreevent' : 'exploreevent'}><img src="data:image/png;base64," alt='' /><Link to="/ExploreEvent" className={activeButton === 'exploreEvent' ? 'link navactive':'link' }>Explore Events</Link></button>
        </div>
        <div className="navbutton">

            {/* navbutton main */}
            <div onClick={()=>{handleButtonClick('nav1'); handleDashNav();}} className={activeButton === 'nav1'?'nav1 nav-item navactive':'nav1 nav-item'}>
           <img src="data:image/png;base64," alt=''/>
              <div className="nav-text">
                <h2>My Events</h2>
                 <p>5</p>
              </div>
            </div>
            {/* end navbutton main */}
            <div className="nav2 nav-item">
            <img src="data:image/png;base64," alt=''/>
              <div className="nav-text">
                <h2>Events Joined</h2>
                 <p>5</p>
              </div>
            </div>
            
        </div>
    </div>

  )
}

export default Dashnav
